import React, { Component } from 'react'
import PropTypes from 'prop-types'

export default class MediaPlayer extends Component {
    static propTypes = {
        prop: PropTypes
    }

    render() {
        return (
            <div>
                <video id="azuremediaplayer" className="azuremediaplayer amp-default-skin amp-big-play-centered" tabIndex={0} />
            </div>
        )
    }
}
